import Card from './components/Card';
import Header from './components/Header';
import Footer from './components/Footer';
import notes from './notes';

function App() {
  return (
    <div>
      <Header title="Keeper" />
      <div>
        {notes.map((note) => {
          return <Card title={note.title} content={note.content} />;
        })}
      </div>
    </div>
  );
}

export default App;
